 import Vue from 'vue' 
<template>
  <img alt="Vue logo" src="./assets/logo.png">
  <HelloWorld msg="Welcome to Your Vue.js App"/>
  <fluent-menu>
  <fluent-menu-item v-on:click.prevent="onClick1">Undo</fluent-menu-item>
  <fluent-menu-item v-on:click.prevent="onClick2">Redo</fluent-menu-item>
  <fluent-divider></fluent-divider>
  <fluent-menu-item role="menuitemcheckbox">Extensions</fluent-menu-item>
  <fluent-menu-item role="menuitemcheckbox">Add ons</fluent-menu-item>
  <fluent-divider></fluent-divider>
  <fluent-menu-item role="menuitemradio">Start</fluent-menu-item>
  <fluent-menu-item role="menuitemradio">End</fluent-menu-item>
</fluent-menu>
</template>

<script>
import HelloWorld from './components/HelloWorld.vue'

export default {
  name: 'App',
  components: {
    HelloWorld
  }
}

Vue.createApp({
  data() {
    return {
      name: 'Vue.js'
    }
  },
  methods: {
    greet(event) {
      // `methods` 内部的 `this` 指向当前活动实例
      alert('Hello ' + this.name + '!')
      // `event` 是原生 DOM event
      if (event) {
        alert(event.target.tagName)
      }
    }
  }
}).mount('#event-with-method')
</script>

<style>
#app {
  font-family: Avenir, Helvetica, Arial, sans-serif;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  text-align: center;
  color: #2c3e50;
  margin-top: 60px;
}
</style>
